function imprimir(nombreReporte, idCobroEnCaja, esVencido) {
    if (typeof(jsPrintSetup) == 'undefined') {
    	instalarJsPrintSetup();
    } else {
        var printContentWrapper = $("#body-content-data").clone();
        var urlReporte = 'http://10.10.149.195:9090/reportes/ReportServletEngine?rpt_nombre=';
        var windowUrl = 'about:blank';
        var uniqueName = new Date();
        var windowName = 'Print' + uniqueName.getTime();
        var printWindow = window.open(windowUrl, windowName, 'left=0,top=0,width=160px,height=10px');

        
        urlReporte = urlReporte + nombreReporte + ".rpt&prm_idCobroEnCaja=" + idCobroEnCaja + "&rpt_folder=cajas&rpt_formato=img";
        
        if(nombreReporte == 'cajasTicket'){
        	urlReporte = urlReporte + '&prm_periodoVencido=' + esVencido;
        }
        
        printWindow.document.write("<script language=\"JavaScript\" src=\"resources/js/print.js\"><\/script>");
        printWindow.document.write("<link rel=\"stylesheet\" type=\"text/css\" href=\"css/print.css\"/></head>");
        //printWindow.document.write(printContentWrapper.html());
        printWindow.document.write(" <img class=\"imgTicket\" src=\" " + urlReporte + " \" \/> ");
        // printWindow.document.write(" <img class=\"imgTicket\" src=\" http://localhost:8080/EjemploReporte/ReporteServlet?rpt_nombre=" + nombreReporte + ".rpt&prm_idCobroEnCaja=" + idCobroEnCaja + "&rpt_folder=cajas&rpt_formato=img&prm_periodoVencido=0 \" \/> ");
        
        // printWindow.document.write(" <img src=\"data:image/jpg;base64,\"/>");
        
        printWindow.document.close();
        printWindow.focus();
        printWindow.onload = imprimirPagina();
        
        printWindow.close();
    }
}


// funcion de impresion utulizando la extension jsPrintSetup
function imprimirPagina() {
    // papel y orientacion
    jsPrintSetup.setOption('orientation', jsPrintSetup.kPortraitOrientation);
    jsPrintSetup.setGlobalOption('paperWidth', 210);
    jsPrintSetup.setGlobalOption('paperHeight', 297);

   
    // jsPrintSetup.setPaperSizeData(9);
    // jsPrintSetup.definePaperSize(9, 9, 'iso_a4', 'iso_a4_210x297mm', 'A4', 210, 297, jsPrintSetup.kPaperSizeMillimeters);

    // margenes
    jsPrintSetup.setOption('marginTop', 0); // 75
    jsPrintSetup.setOption('marginBottom', 0);
    jsPrintSetup.setOption('marginLeft', 0); // 50
    jsPrintSetup.setOption('marginRight', 0);

    // encabezado y pie de pagina
    jsPrintSetup.setOption('headerStrLeft', '');
    jsPrintSetup.setOption('headerStrCenter', '');
    jsPrintSetup.setOption('headerStrRight', '');
    jsPrintSetup.setOption('footerStrLeft', '');
    jsPrintSetup.setOption('footerStrCenter', '');
    jsPrintSetup.setOption('footerStrRight', '');
    
    jsPrintSetup.setSilentPrint(true);
    jsPrintSetup.print();
    //jsPrintSetup.setSilentPrint(false);
}

// funcion para instalar la extension jsPrintSetup en caso que el equipo no la tenga instalada
function instalarJsPrintSetup() {
    if (confirm("No tiene instalado el plugin de impresi&oacute;n, &#191;Desea instalarlo ahora&#63;")) {
        var xpi = new Object();
        xpi['jsprintsetup'] = 'resources/extensiones/js_print_setup-0.9.2-fx.xpi';
        InstallTrigger.install(xpi);
    }
}